import axios from 'axios';
import React, { useEffect, useState } from 'react';
import './getUser.css'; // Import external CSS

const GetUser = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    axios
      .get('http://127.0.0.1:8000/users/use/') // Replace with actual API URL
      .then(response => {
        setUsers(response.data);
      })
      .catch(error => {
        console.error('Users are not found', error);
      });
  }, []); // Important: empty dependency array to run only once

  return (
    <div className="user-list-wrapper">
      <h2>Registered Users</h2>
      {users.map(user => (
        <ul key={user.id} className="user-card">
          <li><strong>First Name:</strong> {user.first_name}</li>
          <li><strong>Last Name:</strong> {user.last_name}</li>
          <li><strong>Email:</strong> {user.email}</li>
          <li><strong>Password:</strong> {user.password}</li>
        </ul>
      ))}
    </div>
  );
};

export default GetUser;
